import React from "react";
import "./Programs.css";

const Programs = () => {
    return ( < div className = "Programs"
        id = "programs" > { /*header*/ } <
        div className = "programs-header" >
        <
        span className = "stroke-text" > Explore our < /span> <
        span > Programs < /span> <
        span className = "stroke-text" > to shape you < /span>

        <
        /div> < /
        div >

    )
}

export default Programs;
